resources.description:
Crypto flow is process (first, and only). Callback is like Paypal's IPN mode, and takes place in the background without user intervention.

A JSON payload (see below) is expected and will be validated.

```
{
    "id": 1,
    "scheduled_for": "2017-01-31T20:50:02Z",
    "event": {
        "id": "24934862-d980-46cb-9402-43c81b0cdba6",
        "resource": "event",
        "type": "charge:created",
        "api_version": "2018-03-22",
        "created_at": "2017-01-31T20:49:02Z",
        "data": {
          "code": "66BEOV2A",
          "name": "The Sovereign Individual",
          "description": "Mastering the Transition to the Information Age",
          "hosted_url": "https://commerce.coinbase.com/charges/66BEOV2A",
          "created_at": "2017-01-31T20:49:02Z",
          "expires_at": "2017-01-31T21:04:02Z",
          "timeline": [
            {
              "time": "2017-01-31T20:49:02Z",
              "status": "NEW"
            }
          ],
          "metadata": {},
          "pricing_type": "no_price",
          "payments": [],
          "addresses": {
            "bitcoin": "mymZkiXhQNd6VWWG7VGSVdDX9bKmviti3U",
            "ethereum": "0x419f91df39951fd4e8acc8f1874b01c0c78ceba6"
          }
        }
    }
}
```

Returns 422 on failure, 200 on success.

Example of a failing response:

```
{
	"errors": [
		{
			"id": 4,
			"reason": "RESOURCE_SOLD_OUT"
		},
		{
			"id": 5,
			"reason": "RESOURCE_NOT_FOUND"
		},
		{
			"id": 7,
			"reason": "RESOURCE_SOLD_OUT"
		},
		{
			"id": 8,
			"reason": "RESOURCE_NOT_FOUND"
		}
	],
	"result": null,
	"message": "ORDER_VERIFICATION_FAILED",
	"version": "v1"
}
```

Valid `'operators' => [ '>', '<', '>=', '<=', '=', '!=', 'LIKE', 'SORT' ]`

Fully dressed examples look like this:

```
{
	"resource": "order",
	"expires": 600,
	"rules": [
		{
			"field": "status",
			"operator": "=",
			"value": "ACTIVE"
		}
	]
}```

field is one of the model fields, operator is one of the operators from above. In case of `SORT`, value is either `ASC` or `DESC`. If a bogus value is provided for the `value` param, it is assumed to be `ASC`.

It is also worth noting that only ONE `SORT` operator will be taken into account, if you provide more than one, they will be ignored.

